webpackJsonp([0x8b2b811349f9],{5438:function(e,t){e.exports={data:{post:{html:'<p>Christopher and I have a Mama-free day today. We went shopping for a CPU and motherboard for a to upgrade a secondary machine for XP. We went low-end (Duron 1000 and ECS K7S5A), which is still better than what is in my main machine. I got things running just as Christopher finished his nap, then stopped. Screwing together PC components is not a good father-son activity with a 2-year-old.</p>\n<p>AOL/Time-Warner/Netscape/CNN/<a href="http://www.washingtonpost.com/wp-dyn/articles/A5064-2002Jan18.html">Red-Hat</a>?!? Not even <a href="http://blackholebrain.editthispage.com/2002/01/18">blackholebrain</a> could make something like this up!</p>',fields:{title:"Home Alone",date:"19 Jan 2002",url:"https://papascott.de/2002-01-19-home-alone/"}}},pathContext:{slug:"/2002-01-19-home-alone/",prev:{fields:{title:"Goma Burns",date:"19 Jan 2002",slug:"/2002-01-19-goma-burns/"}},next:{fields:{title:"The Experiment Will Continue",date:"19 Jan 2002",slug:"/2002-01-19-the-experiment-will-continue/"}}}}}});
